import React from 'react';
import styles from './styles/Dashboard.module.css';

export const RoomCard = ({ deals, type, available, total, price }) => {
  return (
    <div className={styles.roomCard}>
      <div className={styles.roomCardHeader}>
        {deals && (
          <div className={styles.dealsBadge}>
            {deals} Deals
          </div>
        )}
        <img loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/75555d7b9658ef0715c7c826a6c24560af0f9d5e17c18395c1eccbf5bd050f80?placeholderIfAbsent=true&apiKey=523321ab982f4052b2a9d502d3cf6935" alt="" className={styles.roomIcon} />
      </div>
      <div className={styles.roomCardContent}>
        <div className={styles.roomType}>{type}</div>
        <div className={styles.roomAvailability}>
          {available}
          <span className={styles.roomTotal}>/{total}</span>
        </div>
        <div className={styles.roomPrice}>
          <span className={styles.priceAmount}>${price}</span>
          <span className={styles.priceUnit}>/ day</span>
        </div>
      </div>
    </div>
  );
};
